def linear_layer(mat1, mat2, bias, relu=False):
    rows = len(mat1)
    cols = len(mat1[0])
    result = [0] * rows    
    for i in range(rows):
        for j in range(cols):
            result[i] += mat1[i][j] * mat2[j]
        result[i] += bias[i]
        if relu:
            result[i] = max(result[i], 0)
    return result

def argmax(x):
    return max(range(len(x)), key=lambda i: x[i])

class NeuralNetwork:
    def __init__(self, ckpt):        
        self.ckpt = ckpt
        self.num_layers = len(self.ckpt.keys()) // 2

    def __call__(self, x):
        
        y = x
        for i in range(self.num_layers):
            relu = not i==(self.num_layers-1)
            y = linear_layer(self.ckpt[f"layers.{i*2}.weight"], y, self.ckpt[f"layers.{i*2}.bias"], relu=relu)
        
        return y
    
class Player:
    def __init__(self):
        self._my_number = None
        self._column = None
        self._row = None
        self._sight = 9
        self._nn = NeuralNetwork(ckpt)
        self.step:int = None
        self.explored = []
        
        # NN Input Size
        self.state_space = self._sight * self._sight

    def get_name(self) -> str:

        return "Agent V5.0"

    def initialize(self, my_number: int, column: int, row: int):
        
        self._my_number = my_number
        self._column = column
        self._row = row 

        # Check Exploration        
        self.step = 0
        self.explored = [0] * self._row * self._column

    
    
    def move_next(self, map: list[int], my_position: int) -> int:

        input_data = self.preprocess(map, my_position)
        score = self._nn(input_data)

        # preprocess subgrid charactor index 
        sg_index = (self._sight * self._sight) // 2
        candidates = [
            input_data[sg_index - 1],
            input_data[sg_index - self._sight],
            input_data[sg_index + 1],
            input_data[sg_index + self._sight]
        ]

        # Get Candidate
        index = sorted(range(len(score)), key=lambda k: score[k],reverse=True)

        #Calculate Epsilon
        
        
        # Remove Invalid Direction
        valid_indices = []
        for valid in index:
            if candidates[valid] != -1:
                valid_indices.append(valid)

        return_idx = 0
        epsilon = self.explored[my_position] / self.step
        if epsilon > 0.02:
            return_idx = random.randint(0, len(valid_indices)-1)

        return valid_indices[return_idx]
    
    def make_2d_input_map(self, input_map):
        # input to 2d amp
        result = [[0] * self._column for _ in range(self._row)]

        for r in range(self._row):
            result[r] = input_map[r*self._column:r*self._column+self._column ]

        return result

    def sample_pad_2d_input_map(self, map2d, position):
        column = len(map2d[0]) 
        row = len(map2d)
        pad = (self._sight//2)
        
        result = [[-1]*(column+(pad*2)) for _ in  range(row + (pad*2)) ]
        for r in range(row):
            result[r+pad][pad:-pad] = map2d[r]

        state = [
            result[i][position[1]:position[1]+self._sight] 
            for i in range(position[0],position[0]+self._sight)]

        return state

    def index_to_position(self, index):
        return [ index // self._column, index % self._column]

    def firstperson_view(self, state, index):
        position = self.index_to_position(index) # This is correct
        map2d = self.make_2d_input_map(state)
        sample_map = self.sample_pad_2d_input_map(map2d, position)

        return sample_map
    
    def preprocess(self, state, index):
        # Append History
        self.step += 1
        self.explored[index] += 1

        #First attempt : calculate exploration score, remove from state
        # exploration_score  = list(map(lambda x: x*10 / self.step, self.explored))
        # state_with_exploration = list( map(add, state, exploration_score) )


        position = self.index_to_position(index) # This is correct
        map2d = self.make_2d_input_map(state)
        sample_map = self.sample_pad_2d_input_map(map2d, position)
        
        
        player_view = sum(sample_map,[])
        

        return player_view
